import React, {Fragment} from 'react';
import { makeStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import Divider from '@material-ui/core/Divider';

const useStyles = makeStyles((theme) => ({
  root: {
    width: '100%',
    backgroundColor: theme.palette.background.paper,
  },
}));

function HitItem(i, model){
	return (
		<Fragment key={i}> 
					<ListItem button> 
						<ListItemText primary={model.text} />
						<ListItemText primary={model.prob} />
					</ListItem>
					<Divider />

				</Fragment>
	)
}
export default function ListDividers(props) {
	const classes = useStyles();

	const tags = props.tags;
	//const probs = props.probs;
	const listItems = tags.map((each_tag, i) => HitItem(i, model));
	/*const listItems = tags.map((each_tag, i) => {
		return 	<Fragment key={i}> 
					<ListItem button> 
						<ListItemText primary={each_tag} />
					</ListItem>
					<Divider />

				</Fragment>
	});*/
	return (
		<List component="nav" className={classes.root} aria-label="mailbox folders">
		  {listItems}
		</List>
  );
}

